('lt', '_template', 'atutor_is', '<strong><em>ATutor</em></strong> yra Open Source Web-based <strong>turinio valdymo apmokanti sistema (LCMS)</strong> sukurta patogumui ir prieinamumui. Administratoriai gali instaliuoti arba atnaujinti ATutor in per kelias minutes. Pedagogai gali greitai surinkti, sumontuoti, ir perskaityti pristatomaji turinį, ir vesti savo kursus internetu. Studentai adaptuojasi naujoje mokymosi aplinkoje.', '2004-06-08 16:33:08', ''),
('lt', '_template', 'atutor_links', '<p>Išmokite daugiau apie <a href=\"http://atutor.ca/index.php\">ATutor</a> pasinaudojant šiomis nuorodomis:</p> <ul> <li><a href=\"http://www.atutor.ca/howto.php\">ATutor <em>HowTo</em> Course</a> - Išmokite kaip naudoti ATutor šiame aiškinamajame kurse</li> <li><a href=\"http://atutor.ca/atutor/docs/index.php\">FAQs</a> - Dažnai užduodami klausimai su atsakymais</li> <li><a href=\"http://atutor.ca/forums/index.php\">Pagalbos forumai</a> - Forumai vartuotojams</li> <li><a href=\"http://atutor.ca/services/index.php\">pagalbos servizai</a> - Jeigu Jums reikia mūsų pagalbos, kreipkites </li> <li><a href=\"http://atutor.ca/atutor/translate/index.php\">Vertimas</a> - Parsisiuskite kalbų paketą, tapkite vertėju</li> <li><a href=\"http://atutor.ca/services/licensing.php\">Licenzija</a> - ATutor programa prienama nemokamai tam tikriems tikslams </li> <li><a href=\"http://atutor.ca/atutor/download.php\">Parsisiūskite ATutor</a> - Visą sisteminę yrangą, kurios reikia, kad instaliuoti ATutor galima parsisiūsti čia</li> </ul>', '2004-06-08 16:42:52', ''),
