('lt', '_template', 'chat_help_display_blurb', '<p>Pastaba: <em>Pereikite</em> į nuorodas<em>greito pasiekimo funkcija</em>atsiras tik tada, jai buvo aktyvota <em>navigacijos pagalba</em> Jūsu nustatymuose </p> <ul> <li> <em>Pereikite prie greito pasiekimo funkcijos</em> nuoroda viršuje nuves Jus prie greito pasiekimo funkciju sąrašo, reikalingu pokalbių kambariui naudotilink </li> <li> <em>Žinučiu laukas</em> rodo paskutines žinutes (iki dešimt). </li> <li><em>pereiti prie žinučių</em> nuoruodos nuves Jus į žinučių pradžią. (Alt+M+Enter) </li> <li> <em>Atnaujinkite žinutes </em>ši nuoroda leis Jums patikrinti - ar atsirado naujos žinutes(Alt+R+Enter). </li> <li><em>sukurkite žinutę</em> laukas ir<em>Išsiusti mygtukas</em>leidžia jums įvesti ir išsiusti žinutes(Alt+C kad įeiti i sukūrimo lauką, Enter kad išsiusti užbaigta žinute). </li> </ul>', '2004-06-08 18:22:59', ''),
